import React, { Component } from "react";

class Counter extends Component {
  render() {
    const {
      item,
      onClickIncrement,
      onClickDecrement,
      onClickReset,
      onClickRemove
    } = this.props;

    const { name, src, price, quantity } = item;

    return (
      <div>
        <th>
          <img src={src} alt={name} />
        </th>
        <th>
          Price: {price}
          Quantity: {quantity}
        </th>
      </div>
    );
  }
}

export default Counter;
